// src/components/DoctorDashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

function DoctorDashboard() {
  return (
    <div>
      <h1>Doctor Dashboard</h1>
      <Link to="/upload-schedule">Upload Schedule</Link>
      <Link to="/view-appointments">View Appointments</Link>
      <Link to="/join-video-call">Join Video Call</Link>
      <Link to="/view-patient-details">View Patient Details</Link>
      {/* Add more links for other functionalities */}
    </div>
  );
}

export default DoctorDashboard;
